window.bookSummaryJSON = "<p>Now tested in battle, Evan aims to become the heir of Hatra. </p> <p>Once that he’s a lord, Evan has even more on his plate, from rebuilding the city’s aqueducts to fighting demonic hordes. </p> <p>On top of all that, the King of Rahma gives Evan a quest to prove his worth: to find the lost sword of Hatra, which was last seen 1,000 years ago. </p> <p>If Evan can find the sword, he will gain the king’s favor and the princess’s hand in marriage. </p> <p>Good thing he’s a badass dragon.</p>"; 
